const puppeteer = require('puppeteer');

(async () => {
  const browser = await puppeteer.launch({ headless: false });
  const page = await browser.newPage();

  // Set viewport for consistent rendering
  await page.setViewport({ width: 1920, height: 1080 });

  // Navigate to page
  await page.goto('https://dappradar.com/', { 
    waitUntil: 'networkidle0' // Wait for SPA to load
  });



  // Wait for specific elements (adjust selectors based on your needs)
  await page.waitForSelector('[data-testid="main-content"]', { timeout: 30000 });

  // Extract data
  const data = await page.evaluate(() => {
    // Your extraction logic here
    return document.title;
  });

  console.log(data);
  await browser.close();
})();
